import React from "react";
import "../App.css"
import "../index.scss";

const Onerecepie = ({ data}) => {
  return (
    <div>
      
      <div className="receipe-content-area">
        <div className="container">
          <div className="header">
          <img
              className="img"
              src={data.e.recepie_Image }
              alt="food"
            />         
          </div>
          <div className="text">
          <h1 className="food">{data.e.recepie_Name}</h1>
            <i> {data.e.Cook_Time}</i> <br />
            <i> {data.e.Prep_Tim} </i>

            <p className="info">{data.e.recepie_Description}</p>
          </div>
        </div>
      </div>
      
    </div>
  );
};

export default Onerecepie;
